import React from "react";

function Login() {

    return(
        <div className='login'>
      <form
        className={`form form_login`}
        name={`login`}
        // onSubmit={pass}
      >
        <h2 className="login__heading">Вход</h2>

        <fieldset className="login__input-container">
        <label className="login__label">
        <input
          className="login__input login__input_type_pic-link"
          placeholder="Ссылка на аватар"
          defaultValue=""
          type="url"
          name="link"
          id="link-avatar"
          required
          ref={avatarRef}
        />
        <span className="login__input-error link-input-error">
          Введите адрес сайта.
        </span>
      </label>
          <button
            className="login__save-button login__save-button_place_edit-profile"
            type="submit"
          >
            {props.button}
          </button>
        </fieldset>
        <button
          className="login__close login__close-button login__close-button_place_edit-profile"
          onClick={props.onClose}
          type="button"
        ></button>
      </form>
    </div>
    );
}

export default Login;
